script: |
  super -f text -I q11291.spq | sort > q11291.out

inputs:
  - name: q11291.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE col2 * + col0 * col2 NOT BETWEEN NULL AND - col0 + - col1 * tab1.col2 / col0;
  - name: tab1

outputs:
  - name: q11291.out
    data: |
      3	26	54
      64	10	57
      80	13	96
